import React, { Component } from 'react';
import Background from './img/paper-1.jpg';
import './Project.css'



class Projects extends Component{
    render(){
        return(
            <div className="project">
                <div className="project-header">
                    <h3>Popular Projects</h3>
                    <a href="https://github.com/WillLuong97">Explore All</a>
                </div>

                <div className="project-display">
                    <a href="#image"><img src={Background} alt="project-01"/></a>
                    <a href="#image"><img src={Background} alt="project-02"/></a>
                    <a href="#image"><img src={Background} alt="project-03"/></a>                    
                </div>



            </div>
        );
    }
}

//Objects to containt the picture and description of the projects:
const proectObj = [
    {
        picture: Background,
        title: 'Project 01'
    },

    {
        picture: Background,
        title: 'Project 02'
    },
    {
        picture: Background,
        title: 'Project 03'
    },

];


class Icons extends Component{
    render(){
        return(
            <div>
                <span>
                    {this.props.icon}
                </span>
                <h4>{this.props.title}</h4>
                <p>{this.props.description}</p>
            </div>

        );
    }
}



export default Projects;
